  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon Department of Geology & Mineral
  Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
  topographic LiDAR data for multiple areas within the State of Oregon. The areas
  for LiDAR collection have been designed as part of a collaborative effort of state,
  federal, and local agencies in order to meet a wide range of project goals. This
  LiDAR data set was collected over six deliveries from September 14 through October
  27, 2010 and encompasses portions of Klamath and Lake counties in Oregon. This data
  set consists of bare earth and unclassified points. The average pulse density is
  8.61 pulses per square meter over terrestrial surfaces. The area of interest (AOI)
  totals 1054 square miles (674,756 acres) and the total area flown (TAF) covers 1083
  square miles (692,999 acres). The TAF acreage is greater than the original AOI acreage
  due to buffering and flight planning optimization. This metadata record reflects
  all the data and cumulative statistics for the overall lidar survey. In some areas
  of heavy vegetation or forest cover, there may be relatively few ground points in
  the LiDAR data. Elevation values for open water surfaces are not valid elevation
  values because few LiDAR points are returned from water surfaces. LiDAR intensity
  values were also collected. Dates of acquisition for the six deliveries that make
  up this data set. Delivery Area Acquisition Dates AOI Acres TAF Acres 1 Sept 14
  - 22, 2010 104,196 106,995 2 Sept 20 - Oct 18, 2010 67,937 71,599 3 Sept 14 - Oct
  16, 2010 127,789 131,580 4 Oct 6 - 27, 2010 155,387 157,875 5 Sept 23 - Oct 18,
  2010 92,762 95,612 6 Sept 27 - Oct 16, 2010 126,685 129,338\",\n\t\"license_title\":
